import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class TransformAgeService {

  constructor() { }

  transformAge(birthdateData) {
    const birthdate = birthdateData.replace(/-/g, '')
    const year = Number(birthdate.substr(0, 4));
    const today = new Date();
    const month = Number(birthdate.substr(4, 2)) - 1;
    const day = Number(birthdate.substr(6, 2));
    let age = today.getFullYear() - year;
    if (today.getMonth() < month || (today.getMonth() == month && today.getDate() < day)) {
      age--;
    }
    return age;
  }
}

import { Injectable } from '@angular/core';
import * as data from './translate.json';

@Injectable({
  providedIn: 'root'
})
export class TranslateService {
  textTranslate: string;
  dataFormatation: string;
constructor() { }
  veriyLanguage(): void {
    let userLang = navigator.language;
    this.selectLanguage(userLang);
  }
  getDataTranslate(): any {
    return Object.entries(data);
  }
  selectLanguage(language): void {
    let data = this.getDataTranslate();


    switch (language) {
      case 'pt-BR':
        this.traductionLanguage(data[0][1]);
        this.dataFormatation = 'pt';
        break;
      case 'en-US':
        this.traductionLanguage(data[1][1]);
        this.dataFormatation = 'us';
        break;

      default:
        this.traductionLanguage(data[1][1]);
        this.dataFormatation = 'us';
        break;
    }
  }
  traductionLanguage(dataLanguage): void{
    this.textTranslate = dataLanguage;
}
}

